import "./App.css";
import Search from "./components/Search";
import Table from "./components/Table"
export default class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      user: ""
    };
  }

  handleChange = (name) =>{
    this.setState({
      user : name
    })
  }
  componentWillMount(){
    console.log(this.state.user)
  }
  coponentDidUpdate(){
      axios.get('https://api.github.com/search/users', {
          params: {
            q: this.state.user
          }
        })
        .then(function (res) {
            res = res.data
          console.log(res.data);
        })
        .catch(function (error) {
          console.log(error);
        });
  }

  render() {
    return (
      <div>
        <Search changed={this.handleChange} />
        {console.log(this.state.user)}
        <Table name = {this.state.user} />
      </div>
    );
  }
}
